import React from "react";
import './nav.css';
import { Link } from "react-router-dom";

 const NavBar = () => {
  return (
    <nav>

            <ul><Link to="/">Pokedex</Link></ul>
            <li><Link to="/create">Create</Link></li>
            <li><Link to="/team">My team</Link></li>
      
    </nav>
    
  );
};
export default NavBar;
